import React, { useState } from 'react';
import {
  Box,
  Typography,
  IconButton,
  TextField,
  Button,
  Link,
  InputAdornment
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';

export default function LoginModal({ onClose, setShowRegistroVerificar }) {
  const [correo, setCorreo] = useState('');
  const [clave, setClave] = useState('');
  const [showClave, setShowClave] = useState(false);
  const [errores, setErrores] = useState({});
  const [credencialesInvalidas, setCredencialesInvalidas] = useState(false);

  const validarCampos = () => {
    const nuevosErrores = {};
    if (!correo) nuevosErrores.correo = 'Ingrese su correo';
    if (!clave) nuevosErrores.clave = 'Ingrese su contraseña';
    setErrores(nuevosErrores);
    return Object.keys(nuevosErrores).length === 0;
  };

  const handleSubmit = () => {
    if (!validarCampos()) return;

    const usuarioValido = {
      correo: 'demo@correo.com',
      clave: '123456'
    };

    if (correo === usuarioValido.correo && clave === usuarioValido.clave) {
      localStorage.setItem('token', 'demo-token');
      setCredencialesInvalidas(false);
      onClose();
    } else {
      setCredencialesInvalidas(true);
    }
  };

  return (
    <Box
      sx={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: '100vw',
        height: '100vh',
        bgcolor: 'rgba(0,0,0,0.5)',
        zIndex: 1200,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
      }}
    >
      <Box
        sx={{
          position: 'relative',
          width: { xs: '90%', sm: 420 },
          bgcolor: 'white',
          borderRadius: 3,
          boxShadow: 6,
          px: 4,
          pt: 4,
          pb: 3
        }}
      >
        <IconButton onClick={onClose} sx={{ position: 'absolute', top: 12, right: 12 }}>
          <CloseIcon />
        </IconButton>

        <Typography variant="h6" sx={{ fontWeight: 'bold', color: '#2e7d32', mb: 3 }}>
          Iniciar sesión
        </Typography>

        <TextField
          label="Correo electrónico"
          fullWidth
          value={correo}
          onChange={(e) => setCorreo(e.target.value)}
          error={!!errores.correo}
          helperText={errores.correo}
          sx={{ mb: 2 }}
        />

        <TextField
          label="Contraseña"
          fullWidth
          type={showClave ? 'text' : 'password'}
          value={clave}
          onChange={(e) => setClave(e.target.value)}
          error={!!errores.clave}
          helperText={errores.clave}
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton onClick={() => setShowClave(!showClave)} edge="end">
                  {showClave ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            )
          }}
          sx={{ mb: 2 }}
        />

        {credencialesInvalidas && (
          <Typography variant="body2" sx={{ color: '#f44336', mb: 2 }}>
            Las credenciales no son válidas.
          </Typography>
        )}

        <Typography variant="body2" sx={{ textAlign: 'right', mb: 3 }}>
          <Link href="#" underline="hover" sx={{ fontSize: '0.875rem' }}>
            Olvidé mi contraseña
          </Link>
        </Typography>

        <Button
          fullWidth
          variant="contained"
          onClick={handleSubmit}
          sx={{
            bgcolor: '#fb8c00',
            color: 'white',
            fontWeight: 'bold',
            textTransform: 'none',
            py: 1.2,
            fontSize: '0.95rem',
            borderRadius: 2,
            mb: 2,
            '&:hover': { bgcolor: '#f57c00' }
          }}
        >
          Entrar
        </Button>

        <Typography variant="body2" sx={{ textAlign: 'center' }}>
          ¿No tiene una cuenta?{' '}
          <Link
            underline="hover"
            sx={{ fontWeight: 'bold', cursor: 'pointer' }}
            onClick={() => {
              onClose();
              if (setShowRegistroVerificar) {
                setShowRegistroVerificar(true);
              }
            }}
          >
            Regístrate
          </Link>
        </Typography>
      </Box>
    </Box>
  );
}
